window.bookSummaryJSON = "<p>Music mogul, Niko DiLaurentis is all about building his empire and making his money. Raised by the streets and saved by the church, he managed to turn out better than anyone who knew him expected. Now, he has everything he could ever dream of, except her. If she were the type to believe in curses, Rowyn Blackstone would swear one had been placed on her. For as long as she can remember she’s been recovering from one loss after another. But she’s not built to break and her eyes always remain on the prize. Until she sees him again.<br> <br> <b><i>What was his former mentee’s younger sister doing working at The Corporation? </i></b><br> <br> <b><i>How is she supposed to react when her late brother’s best friend calls her into one of the private rooms at a sex club?</i></b><br> <br> Their reunion was as unexpected as the passion that quickly burns between them, but will that be enough to conquer both their demons, and is it too late to live that happy ever after they’d both been afraid to dream of?</p>"; 
